import { Card, Col, Dropdown, Menu, Row } from 'antd'
import React from 'react'
import { Link } from 'react-router-dom';
import Avatar from '../../../assets/img/avatar.png';
import More from '../../../assets/img/iconos/more_vert-24px.svg'

import './CardNode.scss';

export default function CardNode() {

    const menu = (
        <Menu>
          <Menu.Item key="0">
            <Menu.Item key="3"><Link to="/miempresa-edit">Editar datos</Link></Menu.Item>
          </Menu.Item>
        </Menu>
      );

    return (
        <div className="CardNode">
            <Row>
                <Col span={4}>
                    <p><img alt="ico" width="45" src={Avatar} /></p>
                </Col>
                <Col span={14}>
                    <span><b>dato.title</b></span><br/>
                    <span>Programador JR</span> 
                </Col>
                <Col span={6}>
                    <Dropdown overlay={menu} trigger={['click']}>
                        <Link to="#" className="ant-dropdown-link" onClick={e => e.preventDefault()}><img alt="logo" src={More} width="25" height="25" /></Link>
                    </Dropdown>
                </Col>
            </Row>
        </div>
    )
}
